import React, { useEffect, useState } from "react";
import ReactECharts from "echarts-for-react";
import type { EChartsOption } from "echarts";

const Page = () => {
  const [option, setOption] = useState<EChartsOption>({
    tooltip: {
      trigger: "item",
      triggerOn: "mousemove",
    },

    series: {
      type: "sankey",

      emphasis: {
        focus: "trajectory",
      },
      label: {
        ellipsis: "truncate",
        position: "outside",
        //   position: ["outside"],
        fontSize: 12,
        formatter: (param) => {
          return param?.name?.toUpperCase() || "";
        },
      },

      data: [],
      links: [],
      levels: [
        {
          depth: 0,
          itemStyle: {
            color: "#fbb4ae",
          },
          lineStyle: {
            color: "source",
            opacity: 0.6,
          },
        },
        {
          depth: 1,
          itemStyle: {
            color: "#b3cde3",
          },
          lineStyle: {
            color: "source",
            opacity: 0.6,
          },
        },
        {
          depth: 2,
          itemStyle: {
            color: "#ccebc5",
          },
          lineStyle: {
            color: "source",
            opacity: 0.6,
          },
        },
        {
          depth: 3,
          itemStyle: {
            color: "#decbe4",
          },
          lineStyle: {
            color: "source",
            opacity: 0.6,
          },
        },
      ],
      edgeLabel: {
        show: true,
      },
      nodeGap: 30,
    },
  });
  const [data, setData] = useState(() => {
    const initial = getData()
      .filter((x) => x.visited_areas.split(",").length > 1)
      .sort(
        (a, b) =>
          b.visited_areas.split(",").length - a.visited_areas.split(",").length
      )
      .slice(0, 10);

    const links = initial.reduce(
      (prev, curr, index) => {
        const { visited_areas } = curr;
        const toArray = processVisitedAreas(visited_areas, index);
        const nodePairs = createNodePairs(toArray, index, 5);

        prev.push(...nodePairs);

        return prev;
      },
      [] as {
        source: string;
        target: string;
        value: number;
        groupId: number;
      }[]
    );
    const merged = links.reduce((prev, curr) => {
      const srcName = curr.source.split("_")[0];
      const targetName = curr.target.split("_")[0];
      const checkExistIndex = prev.findIndex((x) => {
        const src = x.source.split("_")[0];
        const target = x.target.split("_")[0];
        return srcName == src && targetName == target;
      });
      if (checkExistIndex >= 0) {
        prev[checkExistIndex].value++;
      } else {
        prev.push(curr);
      }

      return prev;
    }, [] as typeof links);
    const nodes = getNodeNamesWithDepth(merged);
    return { nodes, links: merged };
  });
  useEffect(() => {
    if (!data) return;

    setOption((prev) => {
      return {
        ...prev,
        series: { ...prev.series, data: data.nodes, links: data.links },
      };
    });
  }, [data]);

  return (
    <div>
      Page
      <ReactECharts
        lazyUpdate
        style={{ height: "150vh" }}
        // opts={{ width: "auto", height: "150vh" }}
        option={option}
      />
    </div>
  );
};

export default Page;

