function processVisitedAreas(
  visitedAreas: string,
  paramIndex: number
): string[] {
  return visitedAreas
    .split(",")
    .map((area) => area.trim())
    .map((area, index) => `${area}_${paramIndex}_${index}`);
}

function createNodePairs(array: string[], index: number, threshold: number) {
  let pairs = [];
  let actualLength = Math.min(array.length, threshold);

  for (let i = 0; i < actualLength - 1; i++) {
    pairs.push({
      source: array[i],
      target: array[i + 1],
      value: 1,
      groupId: index,
    });
  }

  if (array.length > threshold) {
    pairs.push({
      source: array[threshold - 1],
      target: `${array.length - threshold} more..._${index}`,
      value: 1,
      groupId: index,
    });
  }

  return pairs;
}
function getNodeNamesWithDepth(
  array: { source: string; target: string; value: number; groupId: number }[]
): { name: string; depth: number }[] {
  let nodeMap = new Map<string, number>();

  array.forEach((item) => {
    const sourceDepth = parseInt(item.source.split("_").pop() as string);
    const targetDepth = parseInt(item.target.split("_").pop() as string);

    nodeMap.set(item.source, sourceDepth);
    nodeMap.set(item.target, targetDepth);
  });

  return Array.from(nodeMap).map(([name, depth]) => ({ name, depth }));
}
